import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom'
import 'bootstrap/dist/css/bootstrap.min.css'
import Alert from 'react-bootstrap/Alert'
import './App.css';
import NavBar from './components/NavBar'
import Home from './components/Home'
import User from './components/User'
import Result from './components/Result'

import TestContainer from './containers/TestContainer'

// convert to class based component and add state for user

export default class App extends React.Component {

  state = {
    user: {
      username: "",
      name: "",
      loggedIn: false,
      results: []
    }
  }

  handleLogin = (event) => {
    console.log(event.target)
  }

  render() {

    return ( 
      <Router>
        <div>
          <NavBar user={this.state.user} />
          <Route exact path="/" component={Home} />
          <Route exact path="/login" returnLogin={this.handleLogin} component={User} />
          <Route exact path="/loadtest" user={this.state.user} component={TestContainer} />
          <Route exact path="/results" user={this.state.user} component={Result} />
        </div>

      </Router>

    );

  }
}
